import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { generateUniqueID } from 'web-vitals/dist/modules/lib/generateUniqueID';

const INITIAL_DATA = [
  {
    itemName: 'default item',
    itemStatus: 'uncompleted',
    id: generateUniqueID()
  }
];

TodoList.propTypes = {
  initialData: PropTypes.exact({
    itemName: PropTypes.string,
    itemStatus: PropTypes.string,
    id: PropTypes.string
  })
};

const App = () => {
  console.log(INITIAL_DATA);
  return (
    <>
      <TodoList initialData={INITIAL_DATA} />
    </>
  );
};

const TodoList = (props) => {
  const [data, setData] = useState(props.initialData);
  return (
    <>
      <div>This is a todo list.</div>
      {data.map((data) => (
        <TodoItem key={data.id} name={data.itemName} status={data.itemStatus} />
      ))}
    </>
  );
};

const TodoItem = () => {
  return <div>This is an item.</div>;
};

export default App;
